import logo from './logo.svg';
import React, {useState, useEffect} from 'react';
import './App.css';

function App() {
  const [player, setPlayer] = useState(false);
  useEffect(() => {
    getPlayer();
  }, []);
  function getPlayer() {
    fetch('http://localhost:3001')
      .then(response => {
        return response.text();
      })
      .then(data => {
        setPlayer(data);
      });
  }
  return (
    <div>
    {player ? player : 'There is no merchant data available'}
    <br />
    </div>
  );
}

export default App;
